(201778, 'zhCN', '我们准备好了。带路吧！', '我们准备好了。带路吧！', 35435),
(753, 'zhCN', '什么？你说你干不掉这个东西？', '', 35435),
(195400, 'zhCN', '请让我看看你的合成精华。', '请让我看看你的合成精华。', 35435),
(79796, 'zhCN', '发现萨满之石：烈焰之触', '发现萨满之石：烈焰之触', 35435),
(165870, 'zhCN', '', '等你准备好了，我会告诉你拉斯塔哈陨落的故事。', 35435),
