(194274, 'zhCN', '我想传送到麦卡贡行动（地下城）。', '我想传送到麦卡贡行动（地下城）。', 35435),
(183984, 'zhCN', '|cfff2e699+$1i理智|r', '|cfff2e699+$1i理智|r', 35435),
(201777, 'zhCN', '', '我知道怎么靠近大海的女儿。你准备好了就跟我走。', 35435),
