(79795, 'zhCN', '发现萨满之石：霜狼之灵', '发现萨满之石：霜狼之灵', 35435),
(141708, 'zhCN', '削弱狮鹫，但是要抓牢！使用|TInterface\\ICONS\\INV_MISC_DESECRATED_LEATHERGLOVE.BLP:20|t |cFFFF0000|Hspell:269442|h[抓紧]|h|r。', '', 35435),
(201784, 'zhCN', '我亲眼看到了！吉安娜女士在公海上大打出手！', '', 35435),
(165241, 'zhCN', '深点……再深点……', '深点……再深点……', 35435),
(165243, 'zhCN', '终于……拥抱暗影的真理吧。', '终于……拥抱暗影的真理吧。', 35435),
(165245, 'zhCN', '你的每一次选择，都使你越来越臣服与我。', '你的每一次选择，都使你越来越臣服于我。', 35435),
(165239, 'zhCN', '驾驭你的愤怒……让仇恨变成你的武器。', '驾驭你的愤怒……让仇恨变成你的武器。', 35435),
(165246, 'zhCN', '神的目光足以把它们化为尘埃。', '神的目光足以把它们化为尘埃。', 35435),
(165244, 'zhCN', '很好……靠近点……再靠近点。', '很好……靠近点……再靠近点。', 35435),
(165237, 'zhCN', '啊……你自以为知道力量为何物。', '啊……你自以为知道力量为何物。', 35435);
